import React, { Component } from 'react';
import './footer.css';
import { API_URL } from '../../../config'
import { Modal, Button, message, Form, Input, Spin, Switch, Alert } from 'antd';
import axios from 'axios';
class footer extends Component {

  constructor() {
    super()
    this.state = {
      isModalVisible: false,
      loading: false
    }
  }

  showsuccessmessage = (messages) => {
    message.success({
      content: messages,
      className: 'custom-class',
      style: {
        marginTop: '15vh',
      },
    });
  };
  showerrormessage = (messages) => {
    message.error({
      content: messages,
      className: 'custom-class',
      style: {
        marginTop: '15vh',
      },
    });
  };
  openmodal = () => {
    this.setState({ isModalVisible: true })
  }
  handleOk = () => {

  }
  handleCancel = () => {
    this.setState({ isModalVisible: false })

  }
  onFinish = async (values) => {
    console.log('Success:', values);
    let url = `${API_URL}/api/sor/sso`
    let data = {
      email:values.email,
      password:values.password
    }
    console.log('data', data)
    console.log('url', url)

    try {
    this.setState({ loading: true })

      await axios.post(url, data).then((res) => {
    this.setState({ loading: false })

        console.log('res', res)
        if (res.data.success == false) {
          this.showerrormessage(res.data.message)
          return
        }
        if (res.data.success == true) {
          this.showsuccessmessage('Success');
          setTimeout(()=>{
          this.setState({ isModalVisible: false })
            window.open(res.data.url ,'_blank')
          },2000)
        }

      })
    } catch (ex) {
      console.log('ex', ex)
    this.setState({ loading: false })
      this.showerrormessage(ex.message)
    }


  };

  onFinishFailed = (errorInfo) => {
    console.log('Failed:', errorInfo);
  };
  render() {
    return (
      <div className="footer text-center">
        <ul className="footer__nav">
          <li>
            <a href="javascript:void(0)" onClick={() => { this.openmodal() }}>TRAVEL LOGIN</a>
          </li>
          <li>
            <a target="_blank" href="https://login.tripvalet.com/" target="_blank">INCENTIVES LOGIN</a>
          </li>
          <li>
            <a target="_blank" href="https://9065bd2d-2721-4d72-8902-d3a0c5707eb7.filesusr.com/ugd/027c20_d493e81f5c0c42b3a43be5efed107221.docx?dn=TripValet%20SUBSCRIPTION%20AGREEMENT.docx">TERMS &amp; CONDITIONS</a>
          </li>
        </ul>
        <div className="to__top mt-4">
          <a href="/">TOP</a>
        </div>
        <div className="copyright mt-4">
          <p className="mb-0">©2021 TRIPVALET</p>
        </div>
        <div>

          <Modal style={{ textAlign: "center" }} title="Travel Login" okButtonProps={{ hidden: true }}

            visible={this.state.isModalVisible} onOk={this.handleOk} onCancel={this.handleCancel}>
            <Spin spinning={this.state.loading}>
              <Form
                name="basic"
                labelCol={{ span: 5 }}
                wrapperCol={{ span: 16 }}
                initialValues={{ remember: true }}
                onFinish={this.onFinish}
                onFinishFailed={this.onFinishFailed}
              >
                <Form.Item
                  label="Email"
                  name="email"
                  rules={[{ required: true, message: 'Please input your email!' }]}
                >
                  <Input type='email' />
                </Form.Item>

                <Form.Item
                  label="Password"
                  name="password"
                  rules={[{ required: true, message: 'Please input your password!' }]}
                >
                  <Input.Password />
                </Form.Item>

                <Form.Item wrapperCol={{ offset: 5, span: 16 }}>
                  <Button type="primary" htmlType="submit">
                    Login
        </Button>
                </Form.Item>
              </Form>
            </Spin>
          </Modal>
        </div>

      </div>
    );
  }
}

export default footer;
